import { TextStyle, Page, Layout, EmptyState, FooterHelp, Link, Card, Stack, Heading, Subheading } from '@shopify/polaris';
import { TitleBar, ResourcePicker } from '@shopify/app-bridge-react';
import { useState } from 'react';

const register = () => {
    return(
            <Page fullWidth={true}>
                <Layout>
                    <Layout.Section>
                        <Card>
                                <Heading element="h1"><h1>Registro</h1></Heading>
                                <Heading element="h6">Registro</Heading>
                                <Heading element="p">Registro</Heading>
                                <Heading >Registro</Heading>
                                <Subheading>Accounts</Subheading>
                                <Subheading element="h1">Accounts</Subheading>
                        </Card>
                    </Layout.Section>
                </Layout>
            </Page>
    );
};
export default register;
